Storing by Value: You are storing the actual value of the variable in memory. This means that when you assign one variable to another, a copy of the value is made. Changes to one variable do not affect the other. int bobMoney = 20;
int jeffMoney = bobMoney; // "jeffMoney" gets the value of "bobMoney", not a reference to "bobMoney" jeffMoney = 10; // changing "jeffMoney" does not affect "bobMoney" System.out.println(bobMoney); // 20 Storing by Reference: You are storing a reference or memory address to the location where the actual data is stored. This means that when you assign one variable to another, they both point to the same memory location. Changes to one variable will affect the other because they both refer to the same data. Person bob = new Person("bob", 18);
Person anon = bob; // "anon" now refers to the same object as "bob" anon.setAge(21); // changing "anon" also changes "bob" System.out.println(bob.getAge()); // 21 null really refers to a null reference . This means any Object can have a null value. Any uninitialized Object has no reference to point to; a null reference, or null. NPEs occur when you try to use the typed properties of an object while it points to nothing. This is so no undefined behavior occurs. Java does not provide any means of "null-safety", and so it is the responsibility of the programmer to check for and handle potential null values. FTC specific examples include trying to access the hardwareMap at instantiation, or just never assigning a value to a HardwareDevice.

