Kotlin makes it easy to work with values that can and can't be null, much easier than Java: val neverNull: Int = 10
val nullable: Int? = null The ? lets us know that the variable could be null, and Kotlin will throw compilation warnings if we try to use it without checking and handling it. Some more examples: fun addOrThrow(a: Int?, b: Int?) { val safeA = a ?: throw IllegalStateException("a is null") val safeB = b!! return safeA + safeB
} The ?: operator is known as the Elvis operator (after it's resemblance to Elvis Presley) and means that the code after it gets run only if the left-hand side is null. This allows the function to immediately exit and throw an error before any further processing occurs. The !! operator is a shortcut for this operation. The Elvis operator is more powerful and flexible, but if you don't want to throw a specific error and instead crash immediately, the !! operator will enforce that the value isn't null. Finally: fun nullSafeMethodCall(a: Int?): Double { return a?.toDouble() ?: throw IllegalStateException("a is null")
} We'll combine the concept above with the ?. operator, which performs a null safe method call. If a is null, Kotlin won't try to call .toDouble() on it and will just return null, which will then be caught by the Elvis operator!

